-- ----------------------------
-- View structure for SearchView
-- ----------------------------
DROP VIEW [SearchView]
GO
CREATE VIEW [SearchView] AS 
SELECT ContentId as SearchId, 
	   Title as SearchTitle, 
	   ContentSpotText as SearchSpotText, 
	   SeoUrl as SearchSeoUrl, 
	   CreateDate as SearchCreateDate,
	   1 as SearchType

FROM            dbo.Contents
UNION
SELECT CategoryId as SearchId, 
	   CategoryName as SearchTitle, 
	   CategoryName as SearchSpotText, 
	   SeoUrl as SearchSeoUrl, 
	   CreateDate as SearchCreateDate,
	   2 as SearchType
FROM            dbo.Categories
GO

-- ----------------------------
-- Procedure structure for sp_get_contents
-- ----------------------------
DROP PROCEDURE [sp_get_contents]
GO
CREATE procedure [sp_get_contents]
@PageNo int=1,
@Skip int=5,
@CategoryID int=-1
as
begin
	DECLARE @Start int
	DECLARE @End int

	set @Start=(@PageNo-1)*@Skip;
	set @End=@PageNo*@Skip;

	;WITH ContentCTE AS 
	 ( SELECT * ,ROW_NUMBER() OVER (ORDER BY Sorting Asc,CreateDate Desc) AS RowNumber
	   from (select distinct Contents.* from Contents
			left join ContentCategoryRelations on Contents.ContentId = ContentCategoryRelations.ContentId
			where @CategoryID=-1 or CategoryID=@CategoryID) as cnt
	 )
	SELECT  * FROM ContentCTE
	WHERE RowNumber > @Start AND RowNumber <= @End

end




GO

-- ----------------------------
-- Procedure structure for sp_search
-- ----------------------------
DROP PROCEDURE [sp_search]
GO
CREATE procedure [sp_search]
@SearchText nvarchar(100)
as
begin
	select * from SearchView with(nolock)
	where 
	SearchTitle like '%'+@SearchText+'%' or
	SearchSpotText like '%'+@SearchText+'%'
end




